  a = [-2; 5];
  b = [1; 3];

  # The vector c is a scalar multiple of a, so c = k * a for some scalar k.
  # Since b bisects the angle between a and c, the vectors a, b, and c form a right triangle.
  # Therefore, a . b = 0, and a . c = a . (k * a) = k * a . a.
  # From the given data, we have a . b = 0 and a . c = a . a, so k = 1.

  k = 1;
  c = k * a;
