function probability = shaded_region_probability()
  % The shaded region is the area between the two smallest circles and the two largest circles.
  % The total area of the target is the area of the largest circle.
  % The area of the shaded region is the total area minus the area of the two smallest circles.
  % The probability is the ratio of the shaded region area to the total area.

  r_smallest = 2;
  r_largest = 5;

  total_area = pi * r_largest^2;
  shaded_area = total_area - pi * r_smallest^2;

  probability = shaded_area / total_area;
end

probability = shaded_region_probability();
