  # Given data
  AB = AC = 14;
  BC = 26;

  # Using Apollonius's Theorem, the sum of the distances from any point to the sides of an angle is constant.
  # Therefore, the shortest angle bisector is the one that bisects the angle at A.
  # Let's denote the midpoint of BC as M. Then, AM is the shortest angle bisector.

  # Using the midpoint formula, we find that M has coordinates (AB/2, AC/2) = (7, 7).
  M = [AB/2, AC/2];

  # Using the distance formula, we find that AM = sqrt((x2-x1)^2 + (y2-y1)^2) = sqrt((7-0)^2 + (7-0)^2) = sqrt(98) = 7*sqrt(2).
