function non_shaded_area
  % The area of the non-shaded region is the area of the rectangle minus the area of the two quarter-circles.
  % The radius of the quarter-circles is half the width of the rectangle.
  r = 4 / 2;
  % The area of a quarter-circle is pi*r^2/4.
  quarter_circle_area = pi * r^2 / 4;
  % The area of the rectangle is width*height.
  rectangle_area = 8 * 4;
  % The total area of the two quarter-circles is 2*quarter_circle_area.
  total_quarter_circle_area = 2 * quarter_circle_area;
  % The area of the non-shaded region is the area of the rectangle minus the total area of the quarter-circles.
  non_shaded_area = rectangle_area - total_quarter_circle_area;
  % Print the area of the non-shaded region.
  printf('%.15g\n', non_shaded_area);
