function volume
    # The sides of the base of a triangular pyramid are 3, 4 and 5 feet and the altitude is 6 feet.
    base_side1 = 3;
    base_side2 = 4;
    base_side3 = 5;
    altitude = 6;

    # The area of the base of the pyramid is given by Heron's formula:
    # Area = sqrt(s*(s-a)*(s-b)*(s-c)) where s = (a+b+c)/2
    s = (base_side1 + base_side2 + base_side3) / 2;
    base_area = sqrt(s * (s - base_side1) * (s - base_side2) * (s - base_side3));

    # The volume of the pyramid is given by V = 1/3 * base_area * altitude
    volume = 1/3 * base_area * altitude;

    # Print the volume
    printf('%.15g\n', volume);
