  % Total number of ways to select 2 teams out of 3
  total_ways = 3;

  % Number of ways to select 2 teams out of 3 such that Team A is not selected
  ways_without_team_a = 2;

  % Probability that Team A is not selected on a single day
  probability_single_day = ways_without_team_a / total_ways;

  % Probability that Team A is not selected on two out of three days
