function units_digit
  # The units digit of a number raised to a power repeats in a cycle.
  # For 17, the cycle is 1, 7, 9, 3, 1, 7, 9, 3, ...
  # Therefore, we only need to find the remainder of the power when divided by 4.
  # If the remainder is 0, the units digit is 6.
  # If the remainder is 1, the units digit is 3.
  # If the remainder is 2, the units digit is 9.
  # If the remainder is 3, the units digit is 7.

  base = 17;
  power = 13;

  # Calculate the remainder of the power when divided by 4
  remainder = power % 4;

  # Determine the units digit
  if (remainder == 0)
    units_digit = 6;
  elseif (remainder == 1)
    units_digit = 3;
  elseif (remainder == 2)
    units_digit = 9;
  else
    units_digit = 7;
  end

  # Subtract 17 from the units digit
  units_digit = units_digit - 17;

  # If the result is negative, add 10 to get the units digit
  if (units_digit < 0)
    units_digit = units_digit + 10;
  end

  # Print the units digit
  printf('%.15g\n', units_digit);
end

