function red_rope_length
    % The blue rope was 7 centimeters shorter than the yellow rope.
    % The red rope was four times the length of the blue rope.
    % If the 3 ropes had a combined length of 37 centimeters, what was the length of the red rope in centimeters?

    % Let's denote the length of the blue rope as x.
    % Then the length of the yellow rope is x + 7, and the length of the red rope is 4x.
    % The combined length of the three ropes is x + (x + 7) + 4x = 37.
    % Solving this equation for x gives us the length of the blue rope.
    % Then we can find the length of the red rope by multiplying the length of the blue rope by 4.

