% The problem can be solved programmatically using a simple combinatorial approach.
% We have 6 horizontal lines and 6 vertical lines, so we have a total of 12 lines.
% To form a rectangle, we need to choose 2 lines from the horizontal lines and 2 lines from the vertical lines.
% The number of ways to choose 2 lines from 6 is given by the combination formula C(n, k) = n! / (k!(n-k)!),
% where n is the total number of items, k is the number of items to choose, and ! denotes factorial.
% So, the total number of rectangles is C(6, 2) * C(6, 2).

n = 6;
k = 2;
total_rectangles = factorial(n) / (factorial(k) * factorial(n - k)) * factorial(n) / (factorial(k) * factorial(n - k));

printf('%.15g\n', total_rectangles)

