function volume_tetrahedron
  A = [0, 1, 2];
  B = [3, 0, 1];
  C = [4, 3, 6];
  D = [2, 3, 2];

  # Calculate the vectors AB, AC, and AD
  AB = B - A;
  AC = C - A;
  AD = D - A;

  # Calculate the volume of the tetrahedron
  volume = 1/3 * abs(AB(1)*(AC(2)*AD(3) - AC(3)*AD(2)) - AB(2)*(AC(1)*AD(3) - AC(3)*AD(1)) + AB(3)*(AC(1)*AD(2) - AC(2)*AD(1)));

  # Print the volume
  printf('%.15g\n', volume);
